int RobotDDS_RobotStateDataReader_GetKeyValue_Json(RobotDDS::RobotStateDataReader_ptr dr, char* & json_data, int handle)
{
    RobotDDS::RobotState sample_key;
    ::DDS::ReturnCode_t ret = dr->get_key_value(sample_key, handle);

    if (ret == ::DDS::RETCODE_OK)
    {
        RobotDDS::RobotState sample = RobotDDS_RobotState_DecodeJsonSample(json_data);
        RobotDDS_RobotState_CopyKeys(&sample_key, &sample);
        json_data = RobotDDS_RobotState_EncodeJsonSample(sample);
    }

    return ret;
}

int RobotDDS_RobotStateDataReader_GetKeyValue_Cdr(RobotDDS::RobotStateDataReader_ptr dr, char* & cdr_data, size_t & size_data, int handle)
{
    RobotDDS::RobotState sample_key;
    ::DDS::ReturnCode_t ret = dr->get_key_value(sample_key, handle);

    if (ret == ::DDS::RETCODE_OK)
    {
       RobotDDS_RobotState_serialize_to_bytes(sample_key, cdr_data, size_data);
    }

    return ret;
}
